(19, '', '', 'Do You Lack Credibility On Social Media?\r\n\r\nUnlike competing PR Companies, we''re not big on buzzwords or endless presentations. Our approach is much more practical & results oriented. In short, we get the job \r\n\r\ndone, and done right.\r\n\r\nSpecifically, we can help improve your presence on Online Social Media websites such as Facebook and Twitter. The number of fans and followers that you have on \r\n\r\nFacebook and Twitter are a direct proof of your credibility.\r\n\r\nAnd more importantly, these are effective ways to expand your reach and even go viral!\r\n\r\nThat''s where we come in. Unlike many competing agencies, we don''t send you garbage/poorly targeted fans and followers. Indeed, the more fans the better, but targeting \r\n\r\nis equally important. We target your social media campaign to people who fit the right profile.\r\n\r\nThank you for reading this offer. We understand that your time is extremely valuable, and request that you respect ours as well. If you would like to boost your \r\n\r\nreputation and credibility on social media, write to social@pandapr.com or talk to our Live Agent on our website at http://www.pandapr.com and we''ll get back to you \r\n\r\nPronto!\r\n\r\nPlease note that if you do not have existing Facebook and Twitter pages set up, we will design them for you at no extra cost: Our motto is that a happy customer is a \r\n\r\nrepeat customer!\r\n\r\nsocial@pandapr.com http://www.pandapr.com\r\n\r\nWarm Regards,\r\nHector P. Mota\r\nPanda Public Relations\r\nhttp://www.pandapr.com\r\n888-756-3489', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, 0, 0, 0, 1, 1, '2015-04-20 16:38:41', '2015-04-20 16:38:41');
