(1, '0000-00-00 00:00:00', '2012-04-20 13:33:52', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Forgot Password', 'we will send this mail, when\r\nuser submit the forgot password form.', 'Forgot password', 'Hi ##USERNAME##,\n\nA password reset request has been made for your user account at ##SITE_NAME##.\n\nIf you made this request, please click on\nthe following link:\n\n##RESET_URL##\n\nIf you did not request this action and feel this is in error, please contact us.\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'USERNAME,RESET_URL,SITE_NAME'),
(2, '0000-00-00 00:00:00', '2012-04-20 13:34:15', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Activation Request', 'we will send this mail,\r\nwhen user registering an account he/she will get an activation\r\nrequest.', 'Please activate your ##SITE_NAME## account', 'Hi ##USERNAME##,\n\nYour account has been created. Please visit the following URL to activate your account.\n##ACTIVATION_URL##\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'SITE_NAME,USERNAME,ACTIVATION_URL'),
(3, '0000-00-00 00:00:00', '2012-04-20 13:34:40', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'New User Join', 'we will\r\nsend this mail to admin, when a new user registered in the site.', 'New user joined in ##SITE_NAME## account', 'Hi,\n\nA new user named "##USERNAME##" has joined in ##SITE_NAME## account.\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'SITE_NAME,USERNAME'),
(4, '0000-00-00 00:00:00', '2012-04-20 13:34:58', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Welcome Email', 'we will send this mail, when\r\nuser register in this site and get activate.', 'Welcome to ##SITE_NAME##', 'Hi ##USERNAME##,\n\nWe wish to say a quick hello and thanks for registering at ##SITE_NAME##.\n\nIf you did not request this account and feel this is in error, please contact us at ##CONTACT_MAIL##\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'SITE_NAME, USERNAME, CONTACT_MAIL'),
(5, '0000-00-00 00:00:00', '2012-04-20 13:35:54', '##FIRST_NAME####LAST_NAME## <##FROM_EMAIL##>', '##REPLY_TO_EMAIL##', 'Contact Us', 'We will send this mail to admin, when user submit any\r\ncontact form.', '[##SITE_NAME##] ##SUBJECT##', '##MESSAGE##\n\n----------------------------------------------------\nTelephone  : ##TELEPHONE##\nIP             : ##IP##, ##SITE_ADDR##\nWhois       : http://whois.sc/##IP##\nURL          : ##FROM_URL##\n----------------------------------------------------\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'FROM_URL, IP, TELEPHONE, MESSAGE, SITE_NAME, SUBJECT, FROM_EMAIL, LAST_NAME, FIRST_NAME'),
(6, '0000-00-00 00:00:00', '2012-04-20 13:36:23', '"##SITE_NAME## (auto response)" ##NO_REPLY_EMAIL##', '', 'Contact Us Auto Reply', 'we\r\nwill send this mail ti user, when user submit the contact us form.', '[##SITE_NAME##] RE: ##SUBJECT##', 'Dear ##FIRST_NAME####LAST_NAME##,\n\nThanks for contacting us. We''ll get back to you shortly.\n\nPlease do not reply to this automated response. If you have not contacted us and if you feel this is an error, please contact us through our site ##CONTACT_URL##\n\nThanks,\n##SITE_NAME##\n##SITE_URL##\n\n------ On\n##POST_DATE## you wrote from ##IP##\n-----\n\n##MESSAGE##\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'MESSAGE, POST_DATE, SITE_NAME, CONTACT_URL, FIRST_NAME, LAST_NAME, SUBJECT, SITE_URL'),
(7, '0000-00-00 00:00:00', '2012-04-20 13:36:52', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Membership Fee', 'Pay Membership Fee', '[##SITE_NAME##] Pay Membership Fee', 'Dear ##USERNAME##,\n\nYou have successfully registered with our site ##SITE_NAME##. Please pay your membership fee for activate your account.\n\n##MEMBERSHIP_URL##.\n\nNote: If you paid membership fee then please ignore this email. Thanks for signup with us.\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'USERNAME,MEMBERSHIP_URL,SITE_NAME,SITE_URL'),
