(14, '0000-00-00 00:00:00', '2014-08-21 13:11:09', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'New Appointment Request', 'We will send this mail to\r\ncontest owner, when a user posts a new entry.', 'There is a new request for your appointments!!!', 'Dear ##USERNAME##,\nYour appointment with Dr:##DOCTOR_USERNAME##\n\nWhen: ##APPOINTMENT_DATE_TIME##\n\nWhere: ##ADDRESS##\n\nCall at ##CONTACT_NO##  to modify/cancel booking.\n\nThanks,\n##SITE_NAME##\n##SITE_URL##\n\nPlease do not reply to this email.', 'USERNAME,COMMENT,CONTEST,ENTRY_ID,SITE_NAME'),
