(20, '2012-04-19 15:03:54', '2012-08-16 08:58:09', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Clinic Added Alert to Clinic User', 'We will send this mail to Participant, when the contest has been completed.', '[##SITE_NAME##] New Clinic Added', 'Dear ##USERNAME##,\n\n##CLINIC_NAME## has been added with following details\n\nName: ##CLINIC_NAME##\n\nPhone: ##PHONE##\n\n \nThank you and we look forward to seeing you again at ##SITE_NAME##.\n\nThanks,\n##SITE_NAME##\n##SITE_URL##\n\nPlease do not reply to this email. It was sent from an unattended mailbox, and replies are not reviewed.\n', 'PARTICIPANT, CONTEST_NAME, SITE_NAME, SITE_URL,  ENTRY_NO'),
(21, '2012-04-19 15:03:54', '2012-08-16 09:16:13', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Clinic Doctor Add', 'We will send this mail to corresponding Participant, when the contest prize amount paid.', 'Welcome to ##SITE_NAME##', 'Hi ##USERNAME##,\n\nThe ##CLINIC_NAME## has been added you as a doctor in ##SITE_NAME##.\n\nYour account details.\n##LOGINLABEL##:##USEDTOLOGIN##\nPassword:##PASSWORD##\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'PARTICIPANT, CONTEST_NAME, SITE_NAME, SITE_URL, ENTRY_URL '),
