(27, '2012-04-19 15:03:54', '2012-05-11 11:56:15', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Choose Plan Alert to Doctor User', 'Mail send to contest holder if the participant cancel the\r\nwithdrawal\r\nof a entry', '[##CONTEST_NAME##]  Canceled withdrawal', 'Dear ##USERNAME##,\r\n\r\nCanceled a withdrawal of the  entry\r\n###ENTRY_NO## you have posted for this "##CONTEST_NAME##"\r\ncontest.\r\n\r\nTo view this contest click this\r\nURL,\r\n##CONTEST_URL##\r\n\r\nTo view the entry click this\r\nURL,\r\n##ENTRY_URL##\r\n\r\nThanks,\r\n##SITE_NAME##\r\n##SITE_URL##\r\n', 'USERNAME,CONTEST_URL,ENTRY_NO\r\nCONTEST_NAME,SITE_NAME,\r\nSITE_URL,'),
(28, '2012-08-18 00:00:00', '2012-08-18 00:00:00', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Admin Approve Affiliate', 'We will send this mail to user, when affiliate request is approved   \r\nby administator.', 'Your ##SITE_NAME## affiliate account has been activated', '<h2 style="color: #545454; margin: 0pt 20px 5px; font-family: Helvetica,Arial,sans-serif; font-size: 18px;">Hi           ##USERNAME##,</h2>\r\n<p style="font-family: Helvetica,Arial,sans-serif; color: #545454; margin: 0pt 20px; font-size: 16px; text-align: left; padding: 15px 0px;">Your ##SITE_NAME## affiliate account has been activated.</p>\r\n\r\n<div style="border-top: 1px solid #d6d6d6; padding: 15px 30px 25px; margin: 0pt 30px;">\r\n<h4 style="font-family: Helvetica,Arial,sans-serif; font-size: 22px; font-weight: bold; text-align: center; margin: 0pt 0pt 5px; line-height: 26px; color: #00b5c8;">Thanks,</h4>\r\n<h5 style="font-family: Helvetica,Arial,sans-serif; color: #545454; line-height: 20px; text-align: center; margin: 0pt; font-size: 16px;">##SITE_NAME## -             <a style="color: #00b5c8;" title="##SITE_NAME## - Collective Buying Power" href="##SITE_LINK##" target="_blank">##SITE_LINK##</a></h5>', 'FROM_EMAIL, REPLY_TO_EMAIL, SITE_LINK, SITE_NAME, USERNAME,CONTACT_URL'),
(29, '2014-08-21 00:00:00', '2014-08-21 13:27:21', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'New Appointment Requested form patient', 'We will send this mail to\\r\\nrequested doctor, when a user posts a new entry.', 'New appointment requested for you!!!', 'Dear ##USERNAME##,\n\nYou have Appointment req from ##PATIENT_USERNAME##\nOn: ##APPOINTMENT_DATE_TIME##\nWhere: ##ADDRESS##\n\nPls accept/change from your TC account or call us on ##CONTACT_NO##.\n\nThank you and we look forward to seeing you again at ##SITE_NAME##.\n\nThanks,\n##SITE_NAME##\n##SITE_URL##\n\nPlease do not reply to this email.', 'USERNAME,PATIENT_USERNAME,APPOINTMENT_DATE_TIME,SITE_URL,SITE_NAME');
