(3, 'contestform1_select_1', '', 'Select your industry', 'select', '', NULL, NULL, NULL, 1, 0, 2, 'Accounding & Financial, Agriculture, Animal & pet, Architectural, Art & Design, Attorney & Law, Automotive, Bar & NightClub, Business & Counsulting, ChildCare, Cleaning & Maintenance, Communications', NULL, NULL, 1),
