(6, 'contestform1_radio_1', '', 'Would you business cards designed with your logo?', 'radio', 'We recommend settling on a logo design first and then working with the designers in the latter days of your contest to design the business cards. ', NULL, NULL, NULL, 1, 0, 12, 'No, I just want a logo thanks, Yes, I''d like a business card designed as well (from +$150)', NULL, NULL, 1),
(7, 'contestform1_textarea_2', '', 'What details need to go on your business cards?', 'textarea', 'Eg: On the front your logo and website address. On the back your name title, email address and phone. ', NULL, NULL, NULL, 1, 0, 13, '', NULL, NULL, 1),
(8, 'contestform1_radio_2', '', 'Would you like a free quote to print your business cards?', 'radio', '', NULL, NULL, NULL, 1, 0, 14, 'Yes - I''d like a printing partner to contact me with a free, no obligation quote, No - I will organize printing myself', NULL, NULL, 1),
