(10, 'contestform2_radio_1', '', 'Do you have a logo you want on the stationery', 'radio', '', NULL, NULL, NULL, 2, 0, 0, 'Yes, No (We recommend you launch a logo contest before a stationery contest then)', NULL, NULL, 1),
(11, 'contestform2_text_1', '', 'What brand name do you want on your stationery?', 'text', 'E.g. Acme', NULL, NULL, NULL, 2, 0, 0, '', NULL, NULL, 1),
(12, 'contestform2_textarea_1', '', 'Describe what your organization or product does and its target audience', 'textarea', 'E.g. We sell anvils and other industrial goods to manufacturing companies and hobbyists all over the world.', NULL, NULL, NULL, 2, 0, 0, '', NULL, NULL, 1),
