(14, 'contestform2_checkbox_1', '', 'What stationery items do you want designed?', 'checkbox', 'One item starts at $199. Additional items are $100 each.', NULL, NULL, NULL, 2, 0, 0, 'Business cards, Letterheads, Note/Compliment slips, Envelopes', NULL, NULL, 1),
(15, 'contestform2_textarea_2', '', 'What details do you want on your stationery items?', 'textarea', 'E.g:  Name, title, contact details and website URL (where applicable)', NULL, NULL, NULL, 2, 0, 0, '', NULL, NULL, 1),
(16, 'contestform2_textarea_3', '', 'Do you have ideas about the visual style you want?', 'textarea', 'Providing your thoughts on colors, textures, shapes, photography illustration and typography will help guide designers. ', NULL, NULL, NULL, 2, 0, 0, '', NULL, NULL, 1),
