(31, 'contestform4_select_1', '', 'Select your industry', 'select', '', NULL, NULL, NULL, 4, 0, 0, 'Accounding & Financial, Agriculture, Animal & pet, Architectural, Art & Design, Attorney & Law, Automotive, Bar & NightClub, Business & Counsulting, ChildCare, Cleaning & Maintenance, Communications', NULL, NULL, 1),
(32, 'contestform4_textarea_2', '', 'Describe what you want designed', 'textarea', 'Describe your aims and requirements in detail here — the more specific, the better. Tell the designers what is required, but also let them know where they’re free to be creative.', NULL, NULL, NULL, 4, 0, 0, '', NULL, NULL, 1),
(33, 'contestform4_file_1', '', 'Do you have any\r\nimages, sketches or documents that might be helpful?', 'file', 'E.g. Your current logo, photos, illustrations, content, layout ideas etc.', NULL, NULL, NULL, 4, 0, 0, '', NULL, NULL, 1),
(34, 'contestform4_textarea_3', '', 'Is there anything else you would like to communicate to the designers? ', 'textarea', '', NULL, NULL, NULL, 4, 0, 0, '', NULL, NULL, 1),
(35, 'contestform5_text_1', '', 'What is the name of your business or organization?', 'text', 'E.g. Acme', NULL, NULL, NULL, 5, 0, 0, '', NULL, NULL, 1),
