(37, 'contestform5_radio_1', '', 'What kind of brochure do you want designed?', 'radio', '', NULL, NULL, NULL, 5, 0, 0, 'Half-fold (4 sides) , Tri-fold (6 sides) , Gate-fold (3 sides) , ', NULL, NULL, 1),
(38, 'contestform5_textarea_2', '', 'What is required on the front of your brochure?', 'textarea', 'E.g. Title text, photo, illustration, company logo, phone number.', NULL, NULL, NULL, 5, 0, 0, '', NULL, NULL, 1),
