(41, 'contestform5_textarea_5', '', 'Do you have ideas about what visual style you want?', 'textarea', 'E.g. Imagery, typography and colors.  Tip: Providing links or uploading examples you like will greatly help designers.', NULL, NULL, NULL, 5, 0, 0, '', NULL, NULL, 1),
