(44, 'contestform6_text_1', '', 'What is the name of your app?', 'text', 'E.g. Acme', NULL, NULL, NULL, 6, 0, 0, '', NULL, NULL, 1),
(45, 'contestform6_textarea_1', '', 'Briefly describe what your app does', 'textarea', 'E.g. The app allows our customers to browse and purchase anvils on their mobile phone.', NULL, NULL, NULL, 6, 0, 0, '', NULL, NULL, 1),
(46, 'contestform6_select_1', '', 'Select your industry', 'select', '', NULL, NULL, NULL, 6, 0, 0, 'Accounding & Financial, Agriculture, Animal & pet, Architectural, Art & Design, Attorney & Law, Automotive, Bar & NightClub, Business & Counsulting, ChildCare, Cleaning & Maintenance, Communications', NULL, NULL, 1),
(47, 'contestform6_radio_1', '', 'How many screens do you want designed?', 'radio', 'Tip: If you require more than 5 screens, we recommend you focus on identifying a design direction first and then working with the designer 1-to-1 after your contest, to complete the subsequent screens.', NULL, NULL, NULL, 6, 0, 0, '1 screen (from $599), 2 screens (from $749), 3 screens (from $899) , 4 screens (from $1,049), 5 screens (from $1,199)', NULL, NULL, 1),
(48, 'contestform6_textarea_2', '', 'Describe the screens and the main work flows for your app', 'textarea', '  Tip: How do people use your app? How do users move around from screen to screen?  E.g. From the home screen users can either search or browse our range of anvils. From a search results or category page they can go through to an anvil details page. Here ', NULL, NULL, NULL, 6, 0, 0, '', NULL, NULL, 1),
(49, 'contestform6_textarea_3', '', 'What ideas do you have for the style/theme of your app?', 'textarea', 'Tip: Providing your thoughts on colors, textures shapes, photography, illustration and typography will help guide designers. As will providing links to examples you like.', NULL, NULL, NULL, 6, 0, 0, '', NULL, NULL, 1),
