(24, NULL, 0, 'About us', 'about', '<p>Tatkal care is a committed healthcare service provider which is here to provide its users to find the best rated healthcare entity in the local market be it a physician, hospital, lab with easier and quick booking system. It lets you search, choose and select the best provider in any specialty in your area and make an appointment with them. You won&rsquo;t waste any time and it will be confirmed via a phone call or SMS to you.</p>\r\n<p>Tatkal Care also connects patients with doctors and provides information about medical requirements as and whenever required. We allow patients to conveniently schedule their appointments with the doctors of their choice, as per the given criterion depending on the kind of disease or problem they are suffering through at present or in general. Now, patients need not wait longer in queues for appointments and check ups at any doctor''s clinic or hospitals.</p>\r\n<p>By simply registering with Tatkal Care or calling us, one can reach to the doctors/hospitals and book appointments in advance as per their convenience. In addition, health seekers can also gather relevant information on medical events/seminars/health check up camps/ discounted health packages and much more. Tatkal Care is not just a medical portal or serves as a bridge between patients and doctors at numerous levels but also be with you in your health journey. We wish all our esteemed customers to have a great experience being a part of our family.</p>\r\n<p>&nbsp;</p>\r\n<p><strong><span style="font-size: medium;">What Tatkalcare is not for-</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>NOT a medical advisory site</strong></p>\r\n<p>&bull;	We do not suggest, endorse or comment on any medical procedures, conditions or treatments of any kind.</p>\r\n<p>&bull;	We do not promote, endorse or suggest any Doctor, Hospital or clinic as best or better suited for any specific condition or case.</p>\r\n<p>&bull;	Patients are to use their own judgment / volition to assess, choose and connect to Doctors/Clinics /hospitals listed on Tatkalcare.com.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>NOT for emergency medical assistance</strong></p>\r\n<p>&bull;	We are not to be referred to for assistance in emergency medical conditions</p>\r\n<p>&nbsp;</p>\r\n<p><strong>NOT an extension of the Clinic, Hospital or Doctor</strong></p>\r\n<p>&bull;	We are an independent website focused on helping patients.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>We do not have any commercial relationship with Doctors / Clinics / Hospitals for regular listings.</strong></p>\r\n<p>&bull;	Information about a Doctor / Clinic/ Hospital is indicative as we do not undertake any responsibility for any inaccuracy/misrepresentation of Information. However, we make reasonable efforts to keep the information updated from time to time. &bull;	We do not undertake any responsibility for any medical eventuality that might occur subsequent to using services of a Doctor / Clinic / Hospital whose appointment has been booked through Tatkalcare.com We are NOT an assured appointment site &bull;	We do not assure a confirmed appointment for every request on our site. &bull;	Confirmation is subject to clinic / doctor / hospital availability and consent. &bull;	We do try our best to ensure that the appointment is confirmed at the earliest.</p>\r\n<h3><span lang="EN-IN">TCHS Vision</span></h3>\r\n<p><span lang="EN-IN"><img style="float: left;" src="http://www.tatkalcare.com/img/tchs.png" alt="" width="500" height="291" /></span></p>\r\n<ul>\r\n</ul>', '', 1, NULL, 1, 0, 0, '/nodes/slug:about', NULL, 0, 1, 2, NULL, 'page', '2015-02-01 05:27:32', '2014-09-02 10:15:00'),
