misdelivery or defective, delayed or deficient delivery of Products or Services through the Website, and will not be liable to pay any damages, direct or indirect, or consequential damages for loss of revenue, loss of business, loss of data, system crash, faulty operation, malware attacks or slow transmission of the telephone line or web servers or email servers or hardware or software involved in the conduct of the Website technical disruptions, unavailability of Website or its Online Services , delay, failure, interruption, alteration or damage of any data or other information transmitted or posted in connection with use of the Website. That the Website does not guarantee to be error-free or bug-free. We provide no warranty regarding the security, reliability, timeliness, or performance of the Website or its accuracy, suitability or completeness or timeliness, accuracy of profile pages or any information contained therein , updation of the Online Services (including software, text, graphics, links, or communications) provided on or through the use of the Website.<br /> <br /> The Website, Online Services and Materials on Website are provided on an "as is" basis. TatkalCare.com, its owners, its licensors, and its suppliers to the fullest extent permitted by law, disclaim all warranties, express or implied, statutory or otherwise, including but not limited to the implied warranties of merchantability, non-infringement of third parties'' rights, and fitness for particular purpose.<br /> <br /> The defaulting User shall indemnify and agrees to keep Tatkal Care and its subsidiaries and affiliates, and its and their directors, officers, employees, successors and assigns fully harmless against any complaints, suits, actions, claims, losses, damages , liabilities (including statutory liability), penalties, demands and costs (including without limitation, legal costs of Tatkal Care ) ,awards, and/or expenses however arising directly or indirectly from Users or third parties arising in connection with Services and Products offered by other Users on the Website or its quality, performance or legalities including allegations of wrong delivery, misdelivery or defective, delayed or deficient delivery of Services through the Website ,loss of data, system crash or otherwise, and copyright infringement or other intellectual property violations raised by third parties or Customers , or in respect of breach of any of the registered Service provider/vendor''s warranties, representations or undertakings or in any way attributable in whole or in part to registered Service provider''s/vendor''s performance of this Agreement or in relation to the non fulfillment of any of its obligations under this Agreement .<br /> <br /> In the event that Tatkal Care is entitled to be indemnified pursuant to the provisions of this Agreement, Tatkal Care shall be entitled to such extent debit the indemnification amount from the due payments to be made to the Registered Service provider/Vendor.<br /> <br /> The indemnities under this Article are in addition to and without prejudice to the Indemnities given elsewhere in this Agreement and all the indemnities provided herein shall survive the termination of this Agreement.<br /> <br /> Tatkal Care, its owners ,directors, employees or agents, successors assigns, affiliates, subsidiaries mentioned on the Website in any event whatsoever not be liable for any damages (including, without limitation, incidental and consequential damages, direct, indirect, exemplary damages, special or punitive damages, fees, fines, penalties, or liabilities ,personal injury/wrongful death, lost profits, or damages resulting from lost data or business interruption, including any computer virus, anticipated profits, loss of profits or revenues, loss of saving, loss of use interruption of business, loss of opportunity, and claims of customers), whether such damages occur prior or subsequent to or are alleged as a results of, the use or inability to use the Website or the Online Services/Materials,information posted under profile pages, whether based on warranty, contract, tort, or any other legal theory or breach of any of the provisions of this agreement, and whether or not Tatkal Care is advised of the possibility of such damages. In no event shall either Party''s liability be more than amount of Rs.5000&hellip;&hellip; under this agreement.<br /> <br /> Tatkal Care is not liable to refund the Membership fees, if paid nor the facilitation fees charged for any Transaction. The interest free security deposit is not refundable except in accordance with the relevant provisions of this Agreement.<br /> <br /> Tatkal Care does not endorse any professional and does not intend to be a source of advertising, solicitation or advice on the behalf of any professional. To the fullest extent permitted by law, Tatkal Care is not responsible for the content of linked third-party sites; websites framed within the Website, or third-party advertisements, and does not make any representations regarding their content or accuracy. Your use of third-party websites or content is at your own risk and subject to the terms and conditions of use for such websites. Similarly Tatkal Care does not endorse any product advertised on the website.<br /> <br /> That by browsing and/or registering on TatkalCare.com you agree that you are solely responsible for anything you post on the Website and that you agree to defend, indemnify, and hold TatkalCare.com, its owners ,its officers, directors, employees, agents, licensors, and suppliers, successors, assigns fully harmless from and against any claims, actions or demands, liabilities and settlements including without limitation, reasonable legal and accounting fees, resulting from, or alleged to result from, your violation of these Terms and Conditions or any claims based upon your posts/submissions on the Website.<br /> Your sole and exclusive remedy for dissatisfaction with the Site is to stop using the Website and its services.<br /> <br /> Force Majeure:Tatkal care shall not be liable for any delay or non-performance in delivery caused by acts of God, unforeseeable occurrences or other force majeure events beyond the control of &nbsp;Tatkal Care and in such case its obligations shall be suspended for so long as the Force Majeure Event continues. " Force Majure Event" means any event due to any cause beyond the reasonable control of Tatkal Care , including , without limitation, unavailability of any communication system, terrorist attack, war , storm ,fire , flood, earthquake, epidemic or other natural disaster, explosion, acts of God, civil commotion, strikes or industrial, unauthorized access to computer data and storage device, computer crashes, breach of security and encryption, Telecom network strike, breakdown or Payment gateway non function due to international cable fault, bank''s withdrawal of the payment gateway with or without notice, for any reason ,non functioning of the Website due to hacking, malware or boot attacks ,sabotage or server default or server maintenance or breakdown , technical flaw, inadvertent processing delay or impossibility of the use of public or private telecommunication networks and computer networks and other serious disruptions beyond the control of Tatkal Care.<br /> <br /> Confidentiality &amp; Proprietary Information<br /> (a) "Confidential Information" means non public information that Disclosing Party designates as being confidential in writing or orally or it is third party /Customer''s sensitive information which is disclosed in confidence or which under the Confidential Information circumstances surrounding disclosure ought to be treated as confidential "Confidential Information"<br /> (b) For perpetuity from respective disclosure under this Agreement, the receiving Party shall treat as confidential all Confidential Information Provided by the other Party, including the trade secrets, proprietary information, sensitive personal information including health information about Users, or other sensitive information belonging to its customers, financial details, shall not use such Confidential Information except as expressly set forth herein or otherwise authorized in writing, and shall not disclose such Confidential Information to any third party except as may be necessary and required in connection with its rights and obligations under this Agreement . Exceptions: Notwithstanding the above, neither Party shall have liability to the other with regard to any Confidential Information which-<br /> <br /> (i) Was generally known and available in the public domain at the time it was disclosed, or becomes generally known an available in the public domain through no fault of the receiver.<br /> <br /> (ii) Was known to the receiver at the time of disclosure as shown by the files of the receiver in existence at the time of disclosure<br /> <br /> (iii) Is disclosed with the prior written approval of the discloser<br /> <br /> (iv) Is disclosed pursuant to the order or requirement of a court, administrative agency, or other governmental body; provided; that the receiver shall provide reasonable advance notice thereof to enable the discloser to seek a protective order or otherwise prevent such disclosure.<br /> <br /> (c) Right and Remedies<br /> <br /> (i)Receiving Party shall notify Disclosing Party immediately upon discovery of any unauthorized use or disclosure or Confidential Information and /or confidential materials, or any other breach of this Agreement by Receiving Party, and will co-operate with Disclosing Party in every reasonable way to help Disclosing Party regain possession of the Confidential Information and/or Confidential Materials and prevent its further unauthorized use.<br /> <br /> (ii)Receiving Party shall return all originals, copies, reproductions and summaries of confidential Information or Confidential Materials at Disclosing Party''s request, or at Disclosing Party''s option, certify destruction of the same. Receiving party will not commercially or even otherwise utilize any Confidential Information without Disclosing Party''s express prior written consent. Unless otherwise agreed in writing, Receiving party shall not make copies of any Confidential Information for storage or otherwise. This obligation of the Receiving party shall survive the termination of this Agreement and prevail in perpetuity.<br /> <br /> (iii)Receiving Party acknowledges that monetary damages may not be a sufficient remedy for unauthorized disclosure or Confidential Information or Confidential Materials and that Disclosing Party shall be entitled, without waiving any other rights or remedies, to such injunctive or equitable relief as may be deemed proper by a court of competent Jurisdiction.<br /> <br /> Term &amp; Termination:<br /> (a) This Agreement shall come into existence on the date a user browses the Website and/or registers on it and will remain in force for a period of 5 years and automatically renewable on expiry for further 5 years till it is terminated by either party with prior written notice of 15 days.<br /> <br /> (b) This Agreement may be terminated:<br /> <br /> (i) Incase of material breach by a User , Tatkal Care is entitled to terminate this Agreement forthwith and remove any non compliant or other information in connection with Service Provider on its Website or related sites as the case may be.<br /> <br /> (ii) In case of any other breach by a User (i.e. excluding material breach) of any representation, covenant, warranty or term of this Agreement that is not cured within thirty(30) days after written notice thereof by Tatkal Care.<br /> <br /> (c) Effect of Termination<br /> (i). Upon termination of this Agreement the User shall remove its Profile pages, Links, and otherwise discontinue use of the Website or any activity that indicates its association with the Website or Tatkal Care.<br /> <br /> (ii) In case of termination, user shall return the login id and password for access of Website Portal to Tatkal Care or it will be blocked. The parties agree that Tatkal Care shall withhold the credit balance due to the User, if applicable including the interest free security deposits ( if any) for a period of 365 days from the date of notice of termination till satisfactory feedback form is sent by the User after receiving healthcare consultation through the Website online or offline as the case may be.<br /> <br /> (iii) All interest free security deposit (if any) held by Tatkal Care on or after the service of termination notice shall be cleared by Tatkal Care on first in first out basis after the period of 12 months from date of each transaction.<br /> <br /> Jurisdiction and Governing law<br /> (a) This Agreement shall be subject to the exclusive jurisdiction of the courts of Delhi and the laws of India.<br /> <br /> Miscellaneous<br /> (a) Headings: Headings and captions in this Agreement are for convenience only and are not to be used to interpret this Agreement.<br /> <br /> (b) Severability: If any provision of this Agreement is found to be illegal or unenforceable, then, notwithstanding such finding, this Agreement shall remain in full force and effect and such provision shall be deemed stricken or modified to the minimum extent necessary to make it enforceable; provided, however, that the intent of the Parties when entering into this Agreement is maintained.<br /> <br /> (c) Waiver: A failure by any party hereto to exercise or enforce any right conferred upon it by this Agreement shall not be deemed to be a waiver of any such rights or operate so as to bar the exercise or enforcement thereof at any subsequent time or times.<br /> <br /> (d) Assignment: This Agreement and any rights or obligations hereunder shall not be assigned by a User without the prior written agreement of Tatkal Care. Tatkal Care shall be entitled to assign or transfer its right and obligations under this Agreement to any other person.<br /> <br /> (e) All obligations created by this Agreement shall survive change or termination of the Parties business relationship as the context requires in accordance with natural justice and equity principles.<br /> <br /> (f) Third party links: The portal contains links to websites which are not maintained by the Tatkal Care. Links to third party websites are provided for your convenience and information only. Third party websites are not under the Tatkal Care control and we are not responsible for the content or accuracy of those sites or the products or services offered on or through those sites. Nor can the Tatkal Care guarantee that sites will not change without our knowledge. The inclusion of a link in this website does not imply the Tatkal Care''s endorsement of the third party website nor that we are affiliated with the third party website''s owners or sponsors.<br /> <br /> (g) Entire Agreement: Each Party contains the whole agreement, understandings, representations, conditions, warranties, covenants, and constitutes the sole and entire agreement between the Parties hereto and supersedes all prior communications, written or oral with respect thereto. Notwithstanding the foregoing, nothing in this Agreement shall be deemed to supersede or in any way modify any additional confidentiality or non-disclosure agreement between the Parties.<br /> <br /> (k) Approval<br /> Each party shall ensure all statutory permissions required by it before entering into this Agreement have been granted to it and nothing prohibits or restricts parties from entering into this Agreement.<br /> <br /> Your use of the site, the services and the content is subject to the above Terms &amp; Conditions, Privacy Policy &amp; Disclaimer. If you find these Conditions unacceptable, we request that you do not use this Website.<br /> <br /></p>', '', 1, NULL, 1, 0, 0, '/page/terms-of-use', NULL, 0, 1, 2, NULL, 'page', '2014-08-19 12:35:08', '2014-08-19 12:35:08'),
