(15, NULL, 0, 'privacy policy', 'privacy-policy', '<p><span style="font-family: arial,sans-serif; font-size: 13px;">We value safety and&nbsp;</span><span style="font-family: arial,sans-serif; font-size: 13px; background: #ffffcc;">privacy</span><span style="font-family: arial,sans-serif; font-size: 13px;">&nbsp;of your personal data. We have formulated this&nbsp;</span><span style="font-family: arial,sans-serif; font-size: 13px; background: #ffffcc;">Privacy</span><span style="font-family: arial,sans-serif; font-size: 13px;">&nbsp;Policy  to make the users understand our process of collecting information and  parameters for non-disclosure. This policy is compliant with the IT  (Reasonable security practices and procedures and sensitive personal  data or information) Rules, 2011 passed under IT Act, 2000.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">We advise you to read and expressly agree with our&nbsp;</span><span style="font-family: arial,sans-serif; font-size: 13px; background: #ffffcc;">privacy</span><span style="font-family: arial,sans-serif; font-size: 13px;">&nbsp;policy and terms of use prior to registration on the Website or submitting any personal data or information.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">Throughout  this Policy the term "personal data" refers to the information relating  to the people who register on our website including prospective  patients or their relatives/friends, registered service providers /  vendors, medical practitioner / hospital /pharmacy / clinic. The term  "Company" used in the entire document refers to "Tatkal Care Health  Services, "Tatkal Care" that owns TatkalCare.com, "the Website".</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">Information  Collection and Use Tatkal Care requires your details such as e-mail  address or other personal data such as your name, complete address,  mobile number, age, sex, health information, various habits and  information for your profile. Providing us with this personal  identifiable information is, mandatory. This information can be viewed  by the registered service provider / vendor with whom you book your  appointment and is otherwise not publicly accessible. Your medical  records, history, sexual orientation, physical and mental health  condition shall be accessible only to service provider you wish to  consult and no one else to enable him to render requested healthcare  services to you. Your passwords and financial information such as credit  card details are encrypted when typed online and are not known or  accessible to anyone except you.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">At  the time of the registration of the registered service  providers/vendors, we collect certain registration information including  the name of the doctors, user names and passwords to be used by them,  along with the contact information such as email, address and telephone  number, mobile number etc. This information is maintained with us as  "Registration Information". The contact information of registered  service provider / vendor is published on the website and can be freely  viewed by users of the Website.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">However,  any information that is freely available or accessible in public domain  or furnished under Right to Information Act, 2005 or any other law in  force in India shall not be regarded as sensitive personal data or  information.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">TatkalCare.com  may use any and/or all of the information gathered / provided by  Businesses and / or Consumers for the aforementioned general purposes:</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <span style="font-family: arial,sans-serif; font-size: 13px;">(a) to provide, maintain, administer, and update the Company Services;</span><br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">(b) to study and assess usage of the Company Services;</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <span style="font-family: arial,sans-serif; font-size: 13px;">(c) to support the users of the Company Services, including to correct any errors or failures of the Company Services;</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <span style="font-family: arial,sans-serif; font-size: 13px;">(d) to customize any marketing, advertising, and/or other content presented to users of the Company Services;</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <span style="font-family: arial,sans-serif; font-size: 13px;">(e) to fulfill requests for Company Services and/or products;</span><br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">(f) to improve Company Services;</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <span style="font-family: arial,sans-serif; font-size: 13px;">(g) to conduct research, for statistical surveys and developing summary reports, and/or</span><br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">(h) to provide anonymous reporting and/or data for internal and external clients.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">Our  technical partners who are hired to operate and maintain the Website,  its server, or those entities that assist us in operating the Website  may have access to your personal contact information only to the extent  necessary to perform their functions. However, we have strict  confidentiality agreements with such persons.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">The  Company may share this information with its partners and advertisers  with prior written consent from its users. But if compelled by a legal  order issued by a court of law or directed by a law enforcement  authority, such personal information shall be disclosed as required by  law without any prior notice to users.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">User''s responsibilities</span><br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">It  is a User''s responsibility to provide correct information about its  contact particulars. TatkalCare.com shall send emails or call at the  email addresses/ phone numbers mentioned by a User at the time of  registration. Therefore, if a user has inadvertently registered a wrong  email id or phone number for correspondence, TatkalCare.com offers a  facility to cross check and confirm information submitted at time of  registration or even correct the errors later. Tatkal Care will not be  liable for any incorrect information submitted by a user at any point of  time on&nbsp;</span><a style="font-family: arial,sans-serif; font-size: 13px;" href="http://www.tatkalcare.com/" target="_blank">www.TatkalCare.com</a><span style="font-family: arial,sans-serif; font-size: 13px;">.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">You  are advised not to disclose your personal information such as your  phone number or email address, password or health condition in the blogs  or articles or other forums that is freely accessible by public.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">Information in Profile pages</span><br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">The  registered service provider/vendor &nbsp;is solely responsible for seeking  &nbsp;consent of doctors before providing their profile details and verifying  that only correct and updated information is provided to Tatkal Care  for publishing on the Website. The Registered service provider/vendor is  also under obligation to &nbsp;inform and obtain consent from its doctors  that their profiles shall be promoted on Internet through web promotion  activities connected with the &nbsp;Website. Prior to submitting contact  information and detailed profiles, registered service provider/vendor  shall ensure it has the required authorizations as stated in this clause  and the information provided by them shall be duly signed and stamped  by its authorized representative for the records of the Website .Incase  there are any subsequent changes to the supplied profiles , the same  shall be duly intimated to the Website in writing, duly signed and  stamped by the registered service provider/vendor so that these changes  may be made.The Website publishes profiles either uploaded by registered  service provider /vendor &nbsp;themselves &nbsp;or that is provided by them after  due verification for publication on the Website. In case of any issue  concerning consent or accuracy of any content provided by them, Users  should approach the registered service provider/vendor directly. Incase a  user notifies Website of any incorrect information or description  published on the Website provided by registered service provider/vendor ,  the only liability or obligation of the Website will be to remove or  deactivate the concerned link on the Website.However, the Website shall  not be responsible for deactivating the said inaccurate profile or  information from other websites on the Internet where the information  may have been published due to web promotion activities in connection  with the Website or otherwise.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">Third Party Usage</span><br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">Tatkal Care''s website contains links to other websites. Please note that under any circumstance we are not responsible for the&nbsp;</span><span style="font-family: arial,sans-serif; font-size: 13px; background: #ffffcc;">privacy</span><span style="font-family: arial,sans-serif; font-size: 13px;">&nbsp;policies  of such sites. We recommend our Website users to be cognizant of the  fact that while they visit any other website from TatkalCare.com, they  must read the&nbsp;</span><span style="font-family: arial,sans-serif; font-size: 13px; background: #ffffcc;">privacy</span><span style="font-family: arial,sans-serif; font-size: 13px;">&nbsp;terms of those website that collect personally identifiable information.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">Security</span><br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">The  Company has enforced procedures aimed to safeguard the information it  gathers and stores. The Registered users can access the features of the  Website only by logging into their account using unique user name and  password. It is sole responsibility of the user to safeguard their user  name and password. The Company has applied firewalls and has made use of  other modern and highly secured protection technologies which we  believe to be appropriate in an effort to prevent unauthorized  interference or access from outside by intruders. Tatkal Care has taken  all reasonable measures to secure its computer resource and information  contained therein following the reasonable security practices and  procedures as prescribed in the Information Technology (Reasonable  security practices and procedures and sensitive personal Information)  Rules, 2011. We comply with ISO 27001 certification prescribed in these  rules to maintain security practices.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">However,  despite taking due security measures prescribed by law, Company does  not ensure the security of its systems or any information stored or  maintained on these systems at all points as no security measures are  impeccable or impenetrable. Also, the Company cannot control the  activities of others. Although highly unlikely, hardware or software  application failure, and other issues may compromise the protection of  the information Company gathers and stores. In such case, the Company is  not at all responsible for any breach of&nbsp;</span><span style="font-family: arial,sans-serif; font-size: 13px; background: #ffffcc;">privacy</span><span style="font-family: arial,sans-serif; font-size: 13px;">&nbsp;or security caused due to technical failures, hacking attacks or other circumstances beyond its reasonable control.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">Amendments in Registration and Contact Information</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <span style="font-family: arial,sans-serif; font-size: 13px;">You may  anytime update your user account information by editing the profile  details you entered while registration. In order to update your account  details you are required to log on to your account.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">Cancellation of your Account</span><br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">You  have the option to withdraw your consent given at the time of  registration and by making a written request to cancel your account. In  case you prefer to cancel/ delete your account at TatkalCare.com, you  should know that we may retain your registered information in our  database for future reference. You need to send us account reactivation  request if you wish to reopen your account after deletion/cancellation.  We will manually process your request. It should also be noted that the  account reactivation time depends upon other pending reopening requests.  In case of cancelled accounts, the Company is entitled to cancel or  withdraw any services/products to be rendered to a user from date of  receipt of notice of cancellation.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">Communication Terms</span><br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">When  you accept to avail of our Services, we assume that you agree that the  Company may contact you and send you communications as the Company deems  reasonably necessary. The Company may also, send you certain  promotional emails/SMS from time to time. If you do not wish to receive  promotional e-mails/SMS you may opt out from receiving the email/SMS.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">Complying with age of majority and law</span><br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">TatkalCare.com does not collect any personal information deliberately from the users under 18 years of age.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">Changes to the&nbsp;</span><span style="font-family: arial,sans-serif; font-size: 13px; background: #ffffcc;">Privacy</span><span style="font-family: arial,sans-serif; font-size: 13px;">&nbsp;and Security Policy</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <span style="font-family: arial,sans-serif; font-size: 13px;">&nbsp;We possess the right to change this&nbsp;</span><span style="font-family: arial,sans-serif; font-size: 13px; background: #ffffcc;">Privacy</span><span style="font-family: arial,sans-serif; font-size: 13px;">&nbsp;and  Security Policy without notification. If you disagree with the changes,  you may cease from using the Company''s Services and get your account  deleted by a written notice of cancellation of the account. By  registering, using or accessing the Company Service(s), you are  expressly consenting to&nbsp;</span><span style="font-family: arial,sans-serif; font-size: 13px; background: #ffffcc;">privacy</span><span style="font-family: arial,sans-serif; font-size: 13px;">&nbsp;policy and practices described herein.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">Grievance Redressal officer</span><br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">Incase  users have any grievances in connection with the use of the Website, a  user may write to the grievance redressal officer. The grievance  redressal officer is authorized to attend to any user complaints or  queries and resolve any matter within one month from date of receipt of  complaint.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">Using the services of TatkalCare.com is subject to the above Terms &amp; Conditions,&nbsp;</span><span style="font-family: arial,sans-serif; font-size: 13px; background: #ffffcc;">Privacy</span><span style="font-family: arial,sans-serif; font-size: 13px;">&nbsp;Policy &amp; Disclaimer. If you do not accept these Conditions, we request that you should not use this Website.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <span style="font-family: arial,sans-serif; font-size: 13px;">Cookies</span><br style="font-family: arial,sans-serif; font-size: 13px;" /><br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">We do use cookies to store information, such as your personal preferences when you visit our site.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">We  also use third party advertisements on TatkalCare.com to support our  site. Some of these advertisers may use technology such as cookies and  web beacons when they advertise on our site, which will also send these  advertisers (such as Google through the Google AdSense program)  information including your IP address, your ISP , the browser you used  to visit our site, and in some cases, whether you have Flash installed.  This is generally used for geotargeting purposes (showing Delhi real  estate ads to someone in Delhi, for example) or showing certain ads  based on specific sites visited (such as showing cooking ads to someone  who frequents cooking sites).</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">We  also may use DART cookies for ad serving through Google''s DoubleClick,  which places a cookie on your computer when you are browsing the web and  visit a site using DoubleClick advertising (including some Google  AdSense advertisements). This cookie is used to serve ads specific to  you and your interests ("interest based targeting"). The ads served will  be targeted based on your previous browsing history (For example, if  you have been viewing sites about health care service in delhi, you may  see dentist in delhi advertisements when viewing a non-related site,  such as on a site about current affairs). DART uses "non personally  identifiable information". It does NOT track personal information about  you, such as your name, email address, physical address, telephone  number, social security numbers, bank account numbers or credit card  numbers. You can opt-out of this ad serving on all sites using this  advertising by visiting&nbsp;</span><a style="font-family: arial,sans-serif; font-size: 13px;" href="http://www.doubleclick.com/" target="_blank">http://www.doubleclick.com/</a><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">Deleting  cookies does not mean you are permanently opted out of any advertising  program. Unless you have settings that disallow cookies, the next time  you visit a site running the advertisements, a new cookie will be added.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">You  can chose to disable or selectively turn off our cookies or third-party  cookies in your browser settings, or by managing preferences in  programs such as Norton Internet Security. However, this can affect how  you are able to interact with our site as well as other websites. This  could include the inability to login to services or programs, such as  logging into forums or accounts.</span><br style="font-family: arial,sans-serif; font-size: 13px;" /> <br style="font-family: arial,sans-serif; font-size: 13px;" /><br style="font-family: arial,sans-serif; font-size: 13px;" /><span style="font-family: arial,sans-serif; font-size: 13px;">Feel free to contact us with any questions pertaining to our&nbsp;</span><span style="font-family: arial,sans-serif; font-size: 13px; background: #ffffcc;">Privacy</span><span style="font-family: arial,sans-serif; font-size: 13px;">&nbsp;policy at&nbsp;</span><span style="font-family: arial,sans-serif; font-size: 13px; background: #ffffcc;">privacy</span><span style="font-family: arial,sans-serif; font-size: 13px;">@TatkalCare.com Click Here to Read Our Website Content Usage Terms-Conditions</span></p>', '', 1, NULL, 1, 0, 0, '/page/privacy-policy', NULL, 0, 1, 4, NULL, 'page', '2014-08-19 12:32:43', '2014-08-19 12:32:43');
